void Cumulative_CalZ(unsigned char *data, int bits, unsigned int *Z)
{
	int S = 0;
	int maxS = 0;
	int len = bits / 8;

	for (int i = 0; i < len; i++)
	{
		unsigned char index = data[i];
		for (int j = 0; j < 8; j++)
		{
			if (index & 0x80)
			{
				S += 1;
			}
			else
			{
				S -= 1;
			}

			if (abs(S) > maxS)
			{
				maxS = abs(S);
			}

			index <<= 1;
		}
	}
	*Z = maxS;
}

