int Cumulative(double alpha, unsigned char *data, int bits, Cumulative_V *value)
{
	//unsigned int Z = 0;
	double p_value;
	double sum1, sum2;
	int n, k, z;

	n = bits;

	Cumulative_CalZ(data, bits, &z);
	//Cumulative_CalPvalue(bits, Z, p_value);

	//printf("Z: %d\n", Z);
	//printf("P-value: %f\n", p_value);

	//from nist-sts cusum.c
	sum1 = 0.0;
	for (k = (-n / z + 1) / 4; k <= (n / z - 1) / 4; k++) {
		sum1 += cephes_normal(((4 * k + 1)*z) / sqrt(n));
		sum1 -= cephes_normal(((4 * k - 1)*z) / sqrt(n));
	}
	sum2 = 0.0;
	for (k = (-n / z - 3) / 4; k <= (n / z - 1) / 4; k++) {
		sum2 += cephes_normal(((4 * k + 3)*z) / sqrt(n));
		sum2 -= cephes_normal(((4 * k + 1)*z) / sqrt(n));
	}
	p_value = 1.0 - sum1 + sum2;

	if (value)
	{
		value->Z = z;
		value->p_value = p_value;
	}

	if (p_value < alpha)
		return 0;//
	return 1;//
}

